INSERT INTO `unit_data` VALUES (/*unit_id*/114001, /*unit_name*/"レイ（ハロウィン）", /*kana*/"れい", /*prefab_id*/114001, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/375, /*atk_type*/1, /*normal_atk_cast_time*/1.965, /*cutin_1*/114001, /*cutin_2*/0, /*cutin1_star6*/114001, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【物理】中衛で、手負いの敵を死に誘う、幽雅の剣士。\nＨＰが50％未満の敵に対し放つと、威力が大アップする\n範囲攻撃を繰り出し負傷した敵の戦意を一気に叩き折る。", /*only_disp_owned*/0, /*start_time*/"2020/10/15 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/114101, /*unit_name*/"マツリ（ハロウィン）", /*kana*/"まつり", /*prefab_id*/114101, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/1, /*se_type*/1, /*move_speed*/450, /*search_area_width*/186, /*atk_type*/1, /*normal_atk_cast_time*/2.295, /*cutin_1*/114101, /*cutin_2*/0, /*cutin1_star6*/114101, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【物理】前衛で鋭爪を突き立てるハロウィン騎士見習い。\nユニオンバーストの使用回数に応じて強化されるスキルで\n与えるダメージと行動速度をアップさせ、敵を斬り裂く。", /*only_disp_owned*/0, /*start_time*/"2022/07/19 8:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/114201, /*unit_name*/"モニカ（マジカル）", /*kana*/"もにか", /*prefab_id*/114201, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/528, /*atk_type*/1, /*normal_atk_cast_time*/2.24, /*cutin_1*/114201, /*cutin_2*/0, /*cutin1_star6*/114201, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【物理】中衛で愛と希望の力を胸に指揮を執る魔法提督。\nユニオンバーストで敵単体の物理防御力を下げ、範囲内の\n味方の物理攻撃力アップスキルで、一気に戦況を決める。", /*only_disp_owned*/0, /*start_time*/"2020/10/31 12:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/114301, /*unit_name*/"トモ（マジカル）", /*kana*/"とも", /*prefab_id*/114301, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/402, /*atk_type*/1, /*normal_atk_cast_time*/2.0, /*cutin_1*/114301, /*cutin_2*/0, /*cutin1_star6*/114301, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【物理】中衛で正義の力を魔法にのせて戦う魔法剣士。\n自身の物理攻撃力を魔法攻撃力に加える魔法少女の力と、\nたゆまぬ努力で獲得した剣技で、華麗な魔法攻撃を放つ。", /*only_disp_owned*/0, /*start_time*/"2020/11/21 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/114401, /*unit_name*/"アキノ（クリスマス）", /*kana*/"あきの", /*prefab_id*/114401, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/189, /*atk_type*/1, /*normal_atk_cast_time*/2.0, /*cutin_1*/114401, /*cutin_2*/0, /*cutin1_star6*/114401, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【物理】前衛で味方のサポートを力に戦う、聖夜の令嬢。\nステータスアップ効果を受けると増加する【聖夜の煌き】\nでスキルを大きく強化し、聖夜を彩る強烈な一撃を放つ。", /*only_disp_owned*/0, /*start_time*/"2022/12/16 12:00:00", /*end_time*/"2022/12/23 11:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/114501, /*unit_name*/"サレン（クリスマス）", /*kana*/"されん", /*prefab_id*/114501, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/150, /*atk_type*/1, /*normal_atk_cast_time*/2.09, /*cutin_1*/114501, /*cutin_2*/0, /*cutin1_star6*/114501, /*cutin2_star6*/0, /*guild_id*/3, /*exskill_display*/0, /*comment*/"【物理】前衛で、光を操り味方を守る聖夜のサレンママ。\n敵の攻撃を防ぎ、ダメージを与えるユニオンバーストや、\nダメージを与えつつ回復するスキルで、攻守双方を担う。", /*only_disp_owned*/0, /*start_time*/"2020/12/21 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/114601, /*unit_name*/"ユカリ（クリスマス）", /*kana*/"ゆかり", /*prefab_id*/114601, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/408, /*atk_type*/1, /*normal_atk_cast_time*/2.09, /*cutin_1*/114601, /*cutin_2*/0, /*cutin1_star6*/114601, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【物理】中衛で物理キャラを支援し戦う聖夜の元聖騎士。\n魔法攻撃力の高い敵単体のＴＰ減少や周囲の味方の魔法\n防御力アップスキルで、対魔法戦で無類の輝きを放つ。", /*only_disp_owned*/0, /*start_time*/"2022/09/17 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/114701, /*unit_name*/"ムイミ（ニューイヤー）", /*kana*/"むいみ", /*prefab_id*/114701, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/31, /*se_type*/2, /*move_speed*/450, /*search_area_width*/138, /*atk_type*/1, /*normal_atk_cast_time*/2.0, /*cutin_1*/114701, /*cutin_2*/0, /*cutin1_star6*/114701, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【物理】前衛で、新風纏う「天楼覇断剣」を振るう少女。\n皆より一足遅れて突撃し、敵の前衛を吹き飛ばした後、\n強化した範囲物理攻撃で、ダンゴになった敵を斬り払う。", /*only_disp_owned*/0, /*start_time*/"2022/10/16 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/115001, /*unit_name*/"ネネカ（ニューイヤー）", /*kana*/"ねねか", /*prefab_id*/115001, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/21, /*se_type*/7, /*move_speed*/450, /*search_area_width*/562, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/115001, /*cutin_2*/0, /*cutin1_star6*/115001, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【魔法】中衛で艶やかな晴れ着を身に纏う『変貌大妃』。\n味方の魔法攻撃力アップやＨＰ、ＴＰを回復させるスキル\nで攻守にわたってサポートし苛烈な戦況でも勝利に導く。", /*only_disp_owned*/0, /*start_time*/"2023/01/24 12:00:00", /*end_time*/"2023/01/31 11:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/115501, /*unit_name*/"コッコロ（儀装束）", /*kana*/"こっころ", /*prefab_id*/115501, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/2, /*se_type*/2, /*move_speed*/450, /*search_area_width*/533, /*atk_type*/1, /*normal_atk_cast_time*/2.0, /*cutin_1*/115501, /*cutin_2*/0, /*cutin1_star6*/115501, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【物理】中衛で、尊き儀装束を纏うエルフの里の巫女。\n自分の攻撃力を強化し、さらにＴＰ回復で攻撃の手数を\n増やす。クリティカル時の猛攻で仲間を守る剣となる。", /*only_disp_owned*/0, /*start_time*/"2023/02/15 15:00:00", /*end_time*/"2023/02/22 14:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/115601, /*unit_name*/"ユイ（儀装束）", /*kana*/"ゆい", /*prefab_id*/115601, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/578, /*atk_type*/2, /*normal_atk_cast_time*/1.97, /*cutin_1*/115601, /*cutin_2*/0, /*cutin1_star6*/115601, /*cutin2_star6*/0, /*guild_id*/7, /*exskill_display*/0, /*comment*/"【魔法】中衛で精霊術を操り味方を支える儀装の魔法士。\n複数の物理攻撃力の強化スキルで味方を攻撃支援しつつ\n強力な回復スキルで、前線を整えバトルを掌握する。", /*only_disp_owned*/0, /*start_time*/"2022/11/17 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/115701, /*unit_name*/"カスミ（サマー）", /*kana*/"かすみ", /*prefab_id*/115701, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/738, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/115701, /*cutin_2*/0, /*cutin1_star6*/115701, /*cutin2_star6*/0, /*guild_id*/9, /*exskill_display*/0, /*comment*/"【魔法】後衛で、敵の防御力を削ぎ取る渚の名探偵。\n攻撃力が高い敵に目標を定めて防御力を下げつつ、\n味方を強化するスキルで、どんな難事件も解決へと導く。", /*only_disp_owned*/0, /*start_time*/"2021/02/23 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/115801, /*unit_name*/"リマ（シンデレラ）", /*kana*/"りま", /*prefab_id*/115801, /*prefab_id_battle*/116101, /*is_limited*/1, /*rarity*/1, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/173, /*atk_type*/1, /*normal_atk_cast_time*/2.27, /*cutin_1*/115801, /*cutin_2*/0, /*cutin1_star6*/115801, /*cutin2_star6*/0, /*guild_id*/5, /*exskill_display*/0, /*comment*/"【物理】前衛の魔法の果実でお姫様姿になった恋乙女。\n獣の姿からユニオンバーストで一定時間、人の姿に変身し\n味方全体の攻撃力アップスキルで、火力の底上げをする。", /*only_disp_owned*/0, /*start_time*/"2022/12/19 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/115901, /*unit_name*/"マコト（シンデレラ）", /*kana*/"まこと", /*prefab_id*/115901, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/166, /*atk_type*/1, /*normal_atk_cast_time*/2.27, /*cutin_1*/115901, /*cutin_2*/0, /*cutin1_star6*/115901, /*cutin2_star6*/0, /*guild_id*/4, /*exskill_display*/0, /*comment*/"【物理】前衛で、華装に身を包み流麗な剣舞を舞う狼娘。\n周囲の味方の数に応じて、スキルの威力と物理攻撃力\nアップのスキル効果が上がり、鼓舞激励の一斬を振るう。", /*only_disp_owned*/0, /*start_time*/"2021/03/03 19:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/116001, /*unit_name*/"マホ（シンデレラ）", /*kana*/"まほ", /*prefab_id*/116001, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/645, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/116001, /*cutin_2*/0, /*cutin1_star6*/116001, /*cutin2_star6*/0, /*guild_id*/9, /*exskill_display*/0, /*comment*/"【魔法】後衛から、優雅に味方を支援するマホ先生。\n物理攻撃をする味方の攻撃力アップや、最遠の味方のＴＰ\nを回復するスキルで、しゃなりしゃなりと戦況を変える。", /*only_disp_owned*/0, /*start_time*/"2021/03/22 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/116201, /*unit_name*/"クロエ（聖学祭）", /*kana*/"くろえ", /*prefab_id*/116201, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/2, /*se_type*/2, /*move_speed*/450, /*search_area_width*/184, /*atk_type*/1, /*normal_atk_cast_time*/2.125, /*cutin_1*/116201, /*cutin_2*/0, /*cutin1_star6*/116201, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【物理】前衛で疾風の如く駆け抜ける、ダウナー女子。\n特定回数ダメージを与えるたびＴＰを全回復するスキルと\n発動ごとに攻撃力アップのスキルで勝利のテープを掴む。", /*only_disp_owned*/0, /*start_time*/"2021/04/15 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
