INSERT INTO `unit_data` VALUES (/*unit_id*/116701, /*unit_name*/"アオイ（作業服）", /*kana*/"あおい", /*prefab_id*/116701, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/33, /*se_type*/33, /*move_speed*/450, /*search_area_width*/527, /*atk_type*/1, /*normal_atk_cast_time*/1.82, /*cutin_1*/116701, /*cutin_2*/0, /*cutin1_star6*/116701, /*cutin2_star6*/0, /*guild_id*/9, /*exskill_display*/0, /*comment*/"【物理】中衛で敵を妨害する、作業服姿のぼっちエルフ。\n友情の絆で結ばれた『マイフレンドくん』と放つＵＢは、\n敵の動きを阻み、物理防御力を劇的に下げる。", /*only_disp_owned*/0, /*start_time*/"2021/05/31 12:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/116801, /*unit_name*/"タマキ（作業服）", /*kana*/"たまき", /*prefab_id*/116801, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/2, /*se_type*/2, /*move_speed*/450, /*search_area_width*/216, /*atk_type*/1, /*normal_atk_cast_time*/2.295, /*cutin_1*/116801, /*cutin_2*/0, /*cutin1_star6*/116801, /*cutin2_star6*/0, /*guild_id*/8, /*exskill_display*/0, /*comment*/"【物理】前衛でたい焼き器片手に悪を討つ売り子の猫娘。\n味方全体を物理攻撃力アップとＴＰ回復させ、ＵＢでさら\nに自分の攻撃力を特大強化し、驚異の威力を発揮する。", /*only_disp_owned*/0, /*start_time*/"2023/03/16 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/116901, /*unit_name*/"ミフユ（作業服）", /*kana*/"みふゆ", /*prefab_id*/116901, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/275, /*atk_type*/1, /*normal_atk_cast_time*/2.065, /*cutin_1*/116901, /*cutin_2*/0, /*cutin1_star6*/116901, /*cutin2_star6*/0, /*guild_id*/8, /*exskill_display*/0, /*comment*/"【物理】前衛で、皆の盾となり進攻するバイトリーダー。\nバトル序盤は物理の攻防両方をスキルで強化。ＵＢ発動毎\nに自分のクリティカルをアップし猛烈な攻撃を繰り出す。", /*only_disp_owned*/0, /*start_time*/"2021/06/16 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/117001, /*unit_name*/"エリコ（サマー）", /*kana*/"えりこ", /*prefab_id*/117001, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/407, /*atk_type*/1, /*normal_atk_cast_time*/1.55, /*cutin_1*/117001, /*cutin_2*/0, /*cutin1_star6*/117001, /*cutin2_star6*/0, /*guild_id*/11, /*exskill_display*/0, /*comment*/"【物理】中衛で、火花を纏い夕闇を彩る真夏の壊し屋。\n二つのスキルで物理防御力を下げ、ダメージ量に応じて\nクリティカル上昇が延長するＵＢで眼前の敵を粉砕する。", /*only_disp_owned*/0, /*start_time*/"2023/08/26 12:00:00", /*end_time*/"2023/08/31 11:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/117101, /*unit_name*/"シズル（サマー）", /*kana*/"しずる", /*prefab_id*/117101, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/163, /*atk_type*/1, /*normal_atk_cast_time*/2.0, /*cutin_1*/117101, /*cutin_2*/0, /*cutin1_star6*/117101, /*cutin2_star6*/0, /*guild_id*/6, /*exskill_display*/0, /*comment*/"【物理】前衛で、堅牢に仲間を守る海辺のお姉ちゃん。\n物理防御力が高い程、効果が高まる複数のスキルを巧みに\n操り防御と補助役をしつつ範囲攻撃で攻撃役をもこなす。", /*only_disp_owned*/0, /*start_time*/"2021/07/15 12:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/117201, /*unit_name*/"ノゾミ（サマー）", /*kana*/"のぞみ", /*prefab_id*/117201, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/417, /*atk_type*/1, /*normal_atk_cast_time*/2.09, /*cutin_1*/117201, /*cutin_2*/0, /*cutin1_star6*/117201, /*cutin2_star6*/0, /*guild_id*/10, /*exskill_display*/0, /*comment*/"【物理】中衛でみんなを応援する真夏のトップアイドル。\nすべてのスキルで味方全体の物理攻撃をサポートし、\nバトル中盤から味方全体のＴＰ回復で、皆を勝利に導く。", /*only_disp_owned*/0, /*start_time*/"2023/08/26 12:00:00", /*end_time*/"2023/08/31 11:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/117301, /*unit_name*/"チカ（サマー）", /*kana*/"ちか", /*prefab_id*/117301, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/520, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/117301, /*cutin_2*/0, /*cutin1_star6*/117301, /*cutin2_star6*/0, /*guild_id*/10, /*exskill_display*/0, /*comment*/"【魔法】中衛で、守護の賛歌を捧げる夏海の歌姫。\n最序盤に味方の魔法防御を大幅に強化し、吸収バリアや\nＨＰ回復スキルで、如何なる猛攻からも味方を守る。", /*only_disp_owned*/0, /*start_time*/"2021/08/15 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/117401, /*unit_name*/"ツムギ（サマー）", /*kana*/"つむぎ", /*prefab_id*/117401, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/1, /*se_type*/1, /*move_speed*/450, /*search_area_width*/355, /*atk_type*/1, /*normal_atk_cast_time*/2.42, /*cutin_1*/117401, /*cutin_2*/0, /*cutin1_star6*/117401, /*cutin2_star6*/0, /*guild_id*/10, /*exskill_display*/0, /*comment*/"【物理】中衛で敵を引き寄せ陣形を崩す夕凪のテーラー。\n最も攻撃力の高い敵を、敵陣から自陣に引き寄せつつ\n束縛や行動速度ダウンを絡めたスキルで敵の自由を縛る。", /*only_disp_owned*/0, /*start_time*/"2023/05/16 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/117501, /*unit_name*/"ミツキ（オーエド）", /*kana*/"みつき", /*prefab_id*/117501, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/552, /*atk_type*/1, /*normal_atk_cast_time*/2.4, /*cutin_1*/117501, /*cutin_2*/0, /*cutin1_star6*/117501, /*cutin2_star6*/0, /*guild_id*/11, /*exskill_display*/0, /*comment*/"【物理】中衛で、戦況のすべてを見据える隻眼の闇医者。\nＨＰが低い敵を束縛し防御力ダウンスキルで仕掛けつつ\n呪詛の毎秒増加する継続ダメージで敵の命を刻々と蝕む。", /*only_disp_owned*/0, /*start_time*/"2021/09/03 19:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
