INSERT INTO `unit_data` VALUES (/*unit_id*/120701, /*unit_name*/"シェフィ（ニューイヤー）", /*kana*/"しぇふぃ", /*prefab_id*/120701, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/22, /*se_type*/4, /*move_speed*/450, /*search_area_width*/283, /*atk_type*/1, /*normal_atk_cast_time*/1.84, /*cutin_1*/120701, /*cutin_2*/0, /*cutin1_star6*/120701, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", /*only_disp_owned*/0, /*start_time*/"2023/01/10 12:00:00", /*end_time*/"2023/01/15 14:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/120801, /*unit_name*/"ルカ（ニューイヤー）", /*kana*/"るか", /*prefab_id*/120801, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/22, /*se_type*/4, /*move_speed*/450, /*search_area_width*/193, /*atk_type*/1, /*normal_atk_cast_time*/1.3, /*cutin_1*/120801, /*cutin_2*/0, /*cutin1_star6*/120801, /*cutin2_star6*/0, /*guild_id*/2, /*exskill_display*/0, /*comment*/"【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", /*only_disp_owned*/1, /*start_time*/"2021/12/31 12:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/120901, /*unit_name*/"イリヤ（ニューイヤー）", /*kana*/"いりや", /*prefab_id*/120901, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/38, /*se_type*/3, /*move_speed*/450, /*search_area_width*/424, /*atk_type*/2, /*normal_atk_cast_time*/1.425, /*cutin_1*/120901, /*cutin_2*/0, /*cutin1_star6*/120901, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", /*only_disp_owned*/0, /*start_time*/"2023/01/10 12:00:00", /*end_time*/"2023/01/15 14:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/121001, /*unit_name*/"ペコリーヌ（オーバーロード）", /*kana*/"ぺこりーぬ", /*prefab_id*/121001, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/41, /*se_type*/5, /*move_speed*/450, /*search_area_width*/164, /*atk_type*/1, /*normal_atk_cast_time*/2.25, /*cutin_1*/121001, /*cutin_2*/0, /*cutin1_star6*/121001, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", /*only_disp_owned*/0, /*start_time*/"2023/02/15 15:00:00", /*end_time*/"2023/02/22 14:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/121101, /*unit_name*/"キャル（オーバーロード）", /*kana*/"きゃる", /*prefab_id*/121101, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/42, /*se_type*/7, /*move_speed*/450, /*search_area_width*/588, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/121101, /*cutin_2*/0, /*cutin1_star6*/121101, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", /*only_disp_owned*/0, /*start_time*/"2023/02/15 15:00:00", /*end_time*/"2023/02/22 14:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/121201, /*unit_name*/"ラビリスタ（オーバーロード）", /*kana*/"らびりすた", /*prefab_id*/121201, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/40, /*se_type*/4, /*move_speed*/450, /*search_area_width*/260, /*atk_type*/1, /*normal_atk_cast_time*/1.55, /*cutin_1*/121201, /*cutin_2*/0, /*cutin1_star6*/121201, /*cutin2_star6*/0, /*guild_id*/6, /*exskill_display*/0, /*comment*/"【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", /*only_disp_owned*/1, /*start_time*/"2022/02/07 12:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/121301, /*unit_name*/"クルミ（ステージ）", /*kana*/"くるみ", /*prefab_id*/121301, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/731, /*atk_type*/1, /*normal_atk_cast_time*/1.9, /*cutin_1*/121301, /*cutin_2*/0, /*cutin1_star6*/121301, /*cutin2_star6*/0, /*guild_id*/3, /*exskill_display*/0, /*comment*/"【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", /*only_disp_owned*/0, /*start_time*/"2022/03/03 19:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/121401, /*unit_name*/"ミサキ（ステージ）", /*kana*/"みさき", /*prefab_id*/121401, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/742, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/121401, /*cutin_2*/0, /*cutin1_star6*/121401, /*cutin2_star6*/0, /*guild_id*/15, /*exskill_display*/0, /*comment*/"【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", /*only_disp_owned*/0, /*start_time*/"2022/03/15 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/121501, /*unit_name*/"アユミ（怪盗）", /*kana*/"あゆみ", /*prefab_id*/121501, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/590, /*atk_type*/1, /*normal_atk_cast_time*/2.0, /*cutin_1*/121501, /*cutin_2*/0, /*cutin1_star6*/121501, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", /*only_disp_owned*/0, /*start_time*/"2023/04/07 12:00:00", /*end_time*/"2023/04/10 11:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/121601, /*unit_name*/"イノリ（怪盗）", /*kana*/"いのり", /*prefab_id*/121601, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/292, /*atk_type*/1, /*normal_atk_cast_time*/1.425, /*cutin_1*/121601, /*cutin_2*/0, /*cutin1_star6*/121601, /*cutin2_star6*/0, /*guild_id*/17, /*exskill_display*/0, /*comment*/"【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", /*only_disp_owned*/0, /*start_time*/"2022/04/15 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
