INSERT INTO `unit_data` VALUES (/*unit_id*/121901, /*unit_name*/"アンナ（パイレーツ）", /*kana*/"あんな", /*prefab_id*/121901, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/293, /*atk_type*/2, /*normal_atk_cast_time*/2.125, /*cutin_1*/121901, /*cutin_2*/0, /*cutin1_star6*/121901, /*cutin2_star6*/0, /*guild_id*/12, /*exskill_display*/0, /*comment*/"【魔法】前衛で己を鼓舞し高めた魔力を放つ蒼海の冥姫。\n発動の度、攻撃力とクリティカル時ダメージが上昇する\nＵＢと自己犠牲を払う強力な範囲攻撃技で敵を撃滅する。", /*only_disp_owned*/0, /*start_time*/"2022/05/15 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/122001, /*unit_name*/"シノブ（パイレーツ）", /*kana*/"しのぶ", /*prefab_id*/122001, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/380, /*atk_type*/1, /*normal_atk_cast_time*/1.425, /*cutin_1*/122001, /*cutin_2*/0, /*cutin1_star6*/122001, /*cutin2_star6*/0, /*guild_id*/14, /*exskill_display*/0, /*comment*/"【物理】中衛で、彷徨える魂を解き放つ海星の霊能少女。\n攻撃の際、付与する【霊錨の刻印】を駆使し、ダメージ量\nアップのスキルと防御力ダウンのＵＢで敵を浄滅へ導く。", /*only_disp_owned*/0, /*start_time*/"2022/05/03 19:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/122101, /*unit_name*/"アオイ（キャンプ）", /*kana*/"あおい", /*prefab_id*/122101, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/35, /*se_type*/35, /*move_speed*/450, /*search_area_width*/731, /*atk_type*/1, /*normal_atk_cast_time*/1.97, /*cutin_1*/122101, /*cutin_2*/0, /*cutin1_star6*/122101, /*cutin2_star6*/0, /*guild_id*/9, /*exskill_display*/0, /*comment*/"【物理】後衛で百千の矢を放つ、ぼっちの山籠りエルフ。\n物理魔法無効バリアで耐え凌ぎ、敵全体への射撃と自分の\n間合いに入った敵への強力な弓雨の追撃で掃討する。", /*only_disp_owned*/1, /*start_time*/"2022/05/31 12:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/122201, /*unit_name*/"ユカリ（キャンプ）", /*kana*/"ゆかり", /*prefab_id*/122201, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/419, /*atk_type*/1, /*normal_atk_cast_time*/1.84, /*cutin_1*/122201, /*cutin_2*/0, /*cutin1_star6*/122201, /*cutin2_star6*/0, /*guild_id*/8, /*exskill_display*/0, /*comment*/"【物理】中衛で最高の一杯を自然と共に愉しむ元聖騎士。\n【至福のひと時】が増えるほどに、味方の物理攻撃力や\nクリティカル時のダメージを強力に強化し、勝利を掴む。", /*only_disp_owned*/0, /*start_time*/"2022/05/31 12:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/122301, /*unit_name*/"ヴァンピィ", /*kana*/"うぁんぴぃ", /*prefab_id*/122301, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/43, /*se_type*/43, /*move_speed*/450, /*search_area_width*/564, /*atk_type*/2, /*normal_atk_cast_time*/1.425, /*cutin_1*/122301, /*cutin_2*/0, /*cutin1_star6*/122301, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【魔法】中衛で、幼き竜と共に歩むさいきょーの吸血姫。\n味方全体の強化と、敵のＴＰを吸収するスキルで力を蓄え\nＵＢ発動後ベスと共闘し防御ダウンと強撃で攻勢に出る。", /*only_disp_owned*/0, /*start_time*/"2022/06/15 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/122401, /*unit_name*/"ヒヨリ（サマー）", /*kana*/"ひより", /*prefab_id*/122401, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/1, /*se_type*/1, /*move_speed*/450, /*search_area_width*/264, /*atk_type*/1, /*normal_atk_cast_time*/2.42, /*cutin_1*/122401, /*cutin_2*/0, /*cutin1_star6*/122401, /*cutin2_star6*/0, /*guild_id*/8, /*exskill_display*/0, /*comment*/"【物理】前衛で皆にエールを送り鼓舞する真夏の元気娘。\n味方のＨＰを継続回復し行動速度アップの他、味方の数に\n応じてクリティカル強化と攻撃力を引き上げ勝利に導く。", /*only_disp_owned*/1, /*start_time*/"2022/06/30 12:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/122501, /*unit_name*/"レイ（サマー）", /*kana*/"れい", /*prefab_id*/122501, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/250, /*atk_type*/1, /*normal_atk_cast_time*/1.965, /*cutin_1*/122501, /*cutin_2*/0, /*cutin1_star6*/122501, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】前衛で水刃の加護を纏い水面を駆ける渚の剣士。\nクリティカル時のダメージを底上げしＵＢ発動の度、纏う\n【水刃の加護】で全スキルダメージを上げ、敵陣を穿つ。", /*only_disp_owned*/0, /*start_time*/"2023/07/12 12:00:00", /*end_time*/"2023/07/15 14:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/122601, /*unit_name*/"ユイ（サマー）", /*kana*/"ゆい", /*prefab_id*/122601, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/554, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/122601, /*cutin_2*/0, /*cutin1_star6*/122601, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【魔法】中衛で、魔法キャラを補助する夜凪の魔法士。\n累積する攻撃強化スキルとＴＰ回復、物魔両面の無効\nバリアや継続ＨＰ回復で攻守共に味方を支え勝利へ導く。", /*only_disp_owned*/0, /*start_time*/"2022/07/15 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/122701, /*unit_name*/"キョウカ（サマー）", /*kana*/"きょうか", /*prefab_id*/122701, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/812, /*atk_type*/2, /*normal_atk_cast_time*/1.92, /*cutin_1*/122701, /*cutin_2*/0, /*cutin1_star6*/122701, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【魔法】後衛で、難しい魔法の練習に励む海辺の優等生。\nランダムな敵に当たるスキルの威力は攻撃の際に付与する\n【バタフライシール】で増幅し、防御力もダウンさせる。", /*only_disp_owned*/0, /*start_time*/"2022/08/15 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/122801, /*unit_name*/"ミソギ（サマー）", /*kana*/"みそぎ", /*prefab_id*/122801, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/1, /*se_type*/1, /*move_speed*/450, /*search_area_width*/237, /*atk_type*/1, /*normal_atk_cast_time*/2.295, /*cutin_1*/122801, /*cutin_2*/0, /*cutin1_star6*/122801, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】前衛で敵後方に花火を仕掛ける夜涼みの悪戯娘。\n敵の最前衛をスタンで足止めしつつ、最後衛を中心とした\nＵＢで狭範囲の敵を引き寄せ、ＴＰダウンで攻勢を阻む。", /*only_disp_owned*/1, /*start_time*/"2022/07/31 12:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/122901, /*unit_name*/"ミミ（サマー）", /*kana*/"みみ", /*prefab_id*/122901, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/361, /*atk_type*/1, /*normal_atk_cast_time*/2.25, /*cutin_1*/122901, /*cutin_2*/0, /*cutin1_star6*/122901, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】中衛で巨大バルーンと跳ね回る夏色うさぎっこ。\nＵＢやスキルで全てのマルチターゲットに追加ダメージを\n与え、自己強化と防御力ダウンで強敵のブレイクを狙う。", /*only_disp_owned*/0, /*start_time*/"2023/08/09 12:00:00", /*end_time*/"2023/08/12 11:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/123001, /*unit_name*/"アメス", /*kana*/"あめす", /*prefab_id*/123001, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/44, /*se_type*/44, /*move_speed*/450, /*search_area_width*/746, /*atk_type*/2, /*normal_atk_cast_time*/2.27, /*cutin_1*/123001, /*cutin_2*/0, /*cutin1_star6*/123001, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【魔法】後衛で、新たな姿で騎士の冒険を支える妖精。\nダメージカットや防御力アップ、無効バリアで味方を護り\nバリアを起点とする攻撃力とＴＰの支援で攻勢に転ずる。", /*only_disp_owned*/0, /*start_time*/"2023/08/31 12:00:00", /*end_time*/"2023/09/03 18:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/123101, /*unit_name*/"マホ（エクスプローラー）", /*kana*/"まほ", /*prefab_id*/123101, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/793, /*atk_type*/2, /*normal_atk_cast_time*/1.795, /*cutin_1*/123101, /*cutin_2*/0, /*cutin1_star6*/123101, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【魔法】後衛でぬいぐるみ達と大冒険に挑むマホ隊員。\n味方に付与する【ふわふわウール】は被ダメージ時に消費\nされＴＰを回復し、一気呵成の反撃で活路を切り拓く。", /*only_disp_owned*/0, /*start_time*/"2022/09/03 19:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/123201, /*unit_name*/"アヤネ（エクスプローラー）", /*kana*/"あやね", /*prefab_id*/123201, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/256, /*atk_type*/1, /*normal_atk_cast_time*/1.425, /*cutin_1*/123201, /*cutin_2*/0, /*cutin1_star6*/123201, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】前衛で、相棒と困難を越え猛進するアヤネ隊員。\n群る敵を二つの範囲攻撃で一気に捉え、周囲の味方の物理\n攻撃力とクリティカルアップで冒険を阻む壁を打ち崩す。", /*only_disp_owned*/0, /*start_time*/"2022/09/15 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/123301, /*unit_name*/"ネア", /*kana*/"ねあ", /*prefab_id*/123301, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/0, /*se_type*/1, /*move_speed*/450, /*search_area_width*/350, /*atk_type*/1, /*normal_atk_cast_time*/1.62, /*cutin_1*/123301, /*cutin_2*/0, /*cutin1_star6*/123301, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】中衛で粘液を振りまくキイロいスライムギャル。\nスキルで敵全体の物理攻撃能力やＴＰ上昇を低下させ、\nＵＢでスライム化し全敵を攻撃しつつ無敵ボディを得る。", /*only_disp_owned*/0, /*start_time*/"2023/09/12 12:00:00", /*end_time*/"2023/09/15 14:59:59", /*original_unit_id*/0);
