INSERT INTO `unit_data` VALUES (/*unit_id*/123601, /*unit_name*/"トモ（ハロウィン）", /*kana*/"とも", /*prefab_id*/123601, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/262, /*atk_type*/1, /*normal_atk_cast_time*/1.965, /*cutin_1*/123601, /*cutin_2*/0, /*cutin1_star6*/123601, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】前衛で、同志と力を合わせ共に戦う夜廻り剣士。\n自分と物理攻撃力が最も高い味方１キャラの攻撃力を大幅\nに上昇させ、目にもとまらぬ剣技で不届き者を成敗する。", /*only_disp_owned*/0, /*start_time*/"2023/10/10 12:00:00", /*end_time*/"2023/10/15 14:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/123701, /*unit_name*/"ナナカ（ハロウィン）", /*kana*/"ななか", /*prefab_id*/123701, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/21, /*se_type*/7, /*move_speed*/450, /*search_area_width*/741, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/123701, /*cutin_2*/0, /*cutin1_star6*/123701, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【魔法】後衛で、オタ活に精を出すハロウィン魔法少女。\nＨＰ回復量ダウンで敵の戦略を崩し、ダメージフィールド\nと対象の数で火傷の威力を増す熱狂の炎が敵を包み込む。", /*only_disp_owned*/0, /*start_time*/"2022/10/15 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/123801, /*unit_name*/"クリスティーナ（ワイルド）", /*kana*/"くりすてぃーな", /*prefab_id*/123801, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/1, /*se_type*/1, /*move_speed*/450, /*search_area_width*/238, /*atk_type*/1, /*normal_atk_cast_time*/2.295, /*cutin_1*/123801, /*cutin_2*/0, /*cutin1_star6*/123801, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】前衛で、戦場を跳ね回るラビット姿の誓約女君。\n物理攻撃を全て回避するスキルと攻撃力の強化で敵陣に\n単身特攻をかけ、ＵＢの範囲攻撃で敵を内から薙ぎ倒す。", /*only_disp_owned*/0, /*start_time*/"2023/05/27 12:00:00", /*end_time*/"2023/05/31 11:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/123901, /*unit_name*/"マツリ（ワイルド）", /*kana*/"まつり", /*prefab_id*/123901, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/2, /*se_type*/2, /*move_speed*/450, /*search_area_width*/183, /*atk_type*/1, /*normal_atk_cast_time*/2.125, /*cutin_1*/123901, /*cutin_2*/0, /*cutin1_star6*/123901, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】前衛で母製の鎧を纏い気合い上々の獣人族騎士。\n自分のＨＰが低いほど与えるダメージと無効バリアの耐久\n力を高め、防御力ダウンと永続攻撃アップで活路を拓く。", /*only_disp_owned*/0, /*start_time*/"2022/11/15 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/124001, /*unit_name*/"アカリ（クリスマス）", /*kana*/"あかり", /*prefab_id*/124001, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/438, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/124001, /*cutin_2*/0, /*cutin1_star6*/124001, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【魔法】中衛で、聖夜の街に幸せを運ぶ双子の妹サンタ。\n自分の魔法攻撃力に応じて効果が上がる味方全体への攻撃\n力強化に加え、単体特大魔法攻撃で勝利の旋律を奏でる。", /*only_disp_owned*/0, /*start_time*/"2023/06/09 12:00:00", /*end_time*/"2023/06/15 14:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/124101, /*unit_name*/"ヨリ（クリスマス）", /*kana*/"より", /*prefab_id*/124101, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/433, /*atk_type*/2, /*normal_atk_cast_time*/1.965, /*cutin_1*/124101, /*cutin_2*/0, /*cutin1_star6*/124101, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【魔法】中衛で、光を灯し幸せを届ける双子の姉サンタ。\n最も近い１キャラの魔法攻撃力や行動速度アップ、ＴＰの\n回復に加え、全員を支援するスキルで聖夜の勝利を飾る。", /*only_disp_owned*/1, /*start_time*/"2022/11/30 12:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/124201, /*unit_name*/"ジュン（クリスマス）", /*kana*/"じゅん", /*prefab_id*/124201, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/144, /*atk_type*/1, /*normal_atk_cast_time*/2.07, /*cutin_1*/124201, /*cutin_2*/0, /*cutin1_star6*/124201, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】前衛で、味方を庇護し祝福する聖白の騎士団長。\nスキルで後方の味方の攻撃能力を強化、ＴＰを回復させ、\n防御力ダウンと自分のＨＰを回復するＵＢで勝機を掴む。", /*only_disp_owned*/0, /*start_time*/"2022/12/23 12:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
