INSERT INTO `unit_data` VALUES (/*unit_id*/124501, /*unit_name*/"ホマレ（ニューイヤー）", /*kana*/"ほまれ", /*prefab_id*/124501, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/21, /*se_type*/7, /*move_speed*/450, /*search_area_width*/707, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/124501, /*cutin_2*/0, /*cutin1_star6*/124501, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【魔法】後衛で、魔力を笑顔に隠す晴れ着姿の龍の首魁。\n自分の攻撃強化とＴＰ回復をし、ＵＢで放つ曙光の落涙は\n敵数で威力と防御力の減少量を上げ、全ての災厄を祓う。", /*only_disp_owned*/0, /*start_time*/"2023/06/23 12:00:00", /*end_time*/"2023/06/30 11:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/124601, /*unit_name*/"ミサト（ニューイヤー）", /*kana*/"みさと", /*prefab_id*/124601, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/21, /*se_type*/7, /*move_speed*/450, /*search_area_width*/698, /*atk_type*/2, /*normal_atk_cast_time*/2.44, /*cutin_1*/124601, /*cutin_2*/0, /*cutin1_star6*/124601, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【魔法】後衛で真心重ねて味方をもてなす仲居姿の先生。\n全スキルで味方の物理攻撃力とクリティカル能力を上げ、\n魔防やＴＰ上昇の支援とＨＰ、ＴＰの回復で万福を願う。", /*only_disp_owned*/0, /*start_time*/"2023/06/23 12:00:00", /*end_time*/"2023/06/30 11:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/124701, /*unit_name*/"ミツキ（ニューイヤー）", /*kana*/"みつき", /*prefab_id*/124701, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/46, /*se_type*/7, /*move_speed*/450, /*search_area_width*/590, /*atk_type*/1, /*normal_atk_cast_time*/2.24, /*cutin_1*/124701, /*cutin_2*/0, /*cutin1_star6*/124701, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】中衛で、振袖姿で旅館に手を貸す隻眼の闇医者。\n朧ろ状態にした敵への攻撃時、スキルのダメージや防御力\nのダウン値が上昇し、紫煙に捉えた敵を艶然と討ち取る。", /*only_disp_owned*/1, /*start_time*/"2022/12/31 12:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/124801, /*unit_name*/"ノゾミ（リベレイター）", /*kana*/"のぞみ", /*prefab_id*/124801, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/0, /*se_type*/4, /*move_speed*/450, /*search_area_width*/423, /*atk_type*/1, /*normal_atk_cast_time*/2.14, /*cutin_1*/124801, /*cutin_2*/0, /*cutin1_star6*/124801, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】中衛で、未来を信じ希望を灯すトップアイドル。\nバトル開始時に物理キャラのＴＰ特大回復と敵の永続物防\nダウンで加勢し、物理攻撃強化とＴＰ回復で勝利へ導く。", /*only_disp_owned*/0, /*start_time*/"2023/08/12 12:00:00", /*end_time*/"2023/08/15 14:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/124901, /*unit_name*/"カヤ（リベレイター）", /*kana*/"かや", /*prefab_id*/124901, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/0, /*se_type*/1, /*move_speed*/450, /*search_area_width*/170, /*atk_type*/1, /*normal_atk_cast_time*/1.965, /*cutin_1*/124901, /*cutin_2*/0, /*cutin1_star6*/124901, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】前衛で先陣を切り未来を掴む喧嘩屋ドラゴン族。\n初弾が大幅強化するスキルで自分の攻撃力とＴＰを大きく\n高め、威力を増したＵＢで先制し群がる敵を薙ぎ払う。", /*only_disp_owned*/1, /*start_time*/"2023/01/31 12:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/125001, /*unit_name*/"ムイミ（リベレイター）", /*kana*/"むいみ", /*prefab_id*/125001, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/0, /*se_type*/5, /*move_speed*/450, /*search_area_width*/221, /*atk_type*/1, /*normal_atk_cast_time*/1.965, /*cutin_1*/125001, /*cutin_2*/0, /*cutin1_star6*/125001, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】前衛で、相棒と共に明日へと進む大悪党の少女。\n自己強化や物防ダウンを駆使するムイミと、ＵＢ後に一定\n時間共闘するオクトーの追撃で、輝く未来を取り戻す。", /*only_disp_owned*/0, /*start_time*/"2023/08/12 12:00:00", /*end_time*/"2023/08/15 14:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/125101, /*unit_name*/"タマキ（カフェ）", /*kana*/"たまき", /*prefab_id*/125101, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/47, /*se_type*/8, /*move_speed*/450, /*search_area_width*/825, /*atk_type*/1, /*normal_atk_cast_time*/2.24, /*cutin_1*/125101, /*cutin_2*/0, /*cutin1_star6*/125101, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】後衛から客を癒しもてなす猫カフェ店員の猫娘。\n物攻の高いキャラの傍で周囲の物攻アップやＨＰとＴＰを\n回復し、周囲の味方数で強化される攻撃で敵を一掃する。", /*only_disp_owned*/0, /*start_time*/"2023/03/03 19:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/125201, /*unit_name*/"モニカ（カフェ）", /*kana*/"もにか", /*prefab_id*/125201, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/463, /*atk_type*/1, /*normal_atk_cast_time*/1.965, /*cutin_1*/125201, /*cutin_2*/0, /*cutin1_star6*/125201, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】中衛で、駄菓子を振舞い福を蒔く猫カフェ店員。\n攻撃を３回受けるまで味方全体の物理攻撃力を極大アップ\nさせ、２種の物防ダウンスキルで序盤を一気に加勢する。", /*only_disp_owned*/0, /*start_time*/"2023/03/10 12:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/125301, /*unit_name*/"コッコロ（レンジャー）", /*kana*/"こっころ", /*prefab_id*/125301, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/6, /*se_type*/6, /*move_speed*/450, /*search_area_width*/752, /*atk_type*/1, /*normal_atk_cast_time*/2.07, /*cutin_1*/125301, /*cutin_2*/0, /*cutin1_star6*/125301, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】後衛で、わんわんと一緒の新緑レンジャー少女。\n自分の攻撃力に応じて強化される物理攻撃支援スキルや\nＨＰ継続回復、バリアで周囲を支え、絆の勝利へと導く。", /*only_disp_owned*/0, /*start_time*/"2023/03/31 12:00:00", /*end_time*/"2023/04/07 11:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/125401, /*unit_name*/"シオリ（レンジャー）", /*kana*/"しおり", /*prefab_id*/125401, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/8, /*se_type*/8, /*move_speed*/450, /*search_area_width*/710, /*atk_type*/1, /*normal_atk_cast_time*/2.09, /*cutin_1*/125401, /*cutin_2*/0, /*cutin1_star6*/125401, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】後衛で、相棒と共に山を駆ける新米レンジャー。\nスキルで自分の攻撃力とクリティカル時のダメージを上げ\nＴＰを回復し、ダメージと防御力ダウンで敵を追い込む。", /*only_disp_owned*/0, /*start_time*/"2023/04/10 12:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/125501, /*unit_name*/"ジータ（ウォーロック）", /*kana*/"じーた", /*prefab_id*/125501, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/50, /*se_type*/7, /*move_speed*/450, /*search_area_width*/443, /*atk_type*/2, /*normal_atk_cast_time*/1.92, /*cutin_1*/125501, /*cutin_2*/0, /*cutin1_star6*/125501, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【魔法】中衛で、他の術者と魔力を束ねる究竟の魔導士。\n味方への魔法攻撃支援とＴＰ回復に加え、敵陣の攻防両面\nの弱体化で戦況を整え、自らも強力な攻撃魔法を放つ。", /*only_disp_owned*/0, /*start_time*/"2023/04/30 12:00:00", /*end_time*/"2023/05/10 11:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/125601, /*unit_name*/"ビカラ", /*kana*/"びから", /*prefab_id*/125601, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/0, /*se_type*/51, /*move_speed*/450, /*search_area_width*/267, /*atk_type*/1, /*normal_atk_cast_time*/2.09, /*cutin_1*/125601, /*cutin_2*/0, /*cutin1_star6*/125601, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】前衛で夢と希望とネズ耳を届ける鼠神宮の巫女。\n周囲の味方の物理攻撃支援、ＴＰ上昇アップと回復で援護\nし、自身の無敵化で敵の隙を突き鋭い金牙の一撃を放つ。", /*only_disp_owned*/0, /*start_time*/"2023/05/15 15:00:00", /*end_time*/"2023/05/24 11:59:59", /*original_unit_id*/0);
