INSERT INTO `unit_data` VALUES (/*unit_id*/126201, /*unit_name*/"イリヤ（儀装束）", /*kana*/"いりや", /*prefab_id*/126201, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/3, /*se_type*/3, /*move_speed*/450, /*search_area_width*/568, /*atk_type*/2, /*normal_atk_cast_time*/2.09, /*cutin_1*/126201, /*cutin_2*/0, /*cutin1_star6*/126201, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【魔法】中衛で、眷属と永久の血盟を誓う月下の吸血鬼。\nＵＢで眷属を２体喚び、味方への攻撃支援や行動速度上昇\nで強化し、眷属と共に見舞う猛攻で前途を阻む敵を討つ。", /*only_disp_owned*/0, /*start_time*/"2023/05/31 12:00:00", /*end_time*/"2023/06/09 11:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/126301, /*unit_name*/"ユキ（儀装束）", /*kana*/"ゆき", /*prefab_id*/126301, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/9, /*se_type*/7, /*move_speed*/450, /*search_area_width*/456, /*atk_type*/2, /*normal_atk_cast_time*/2.07, /*cutin_1*/126301, /*cutin_2*/0, /*cutin1_star6*/126301, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【魔法】中衛で、闇色の儀装束を纏う「美を統べる者」。\nステータスアップ効果を受け【美貌】を増し、魔法攻撃力\nダウンや味方の強化、ＴＰ回復の効果を高めて解き放つ。", /*only_disp_owned*/0, /*start_time*/"2023/06/15 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/126401, /*unit_name*/"クローチェ", /*kana*/"くろーちぇ", /*prefab_id*/126401, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/1, /*se_type*/1, /*move_speed*/450, /*search_area_width*/373, /*atk_type*/1, /*normal_atk_cast_time*/2.09, /*cutin_1*/126401, /*cutin_2*/0, /*cutin1_star6*/126401, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】中衛で着脱可能な鉄腕を放つ機械人族のロボ娘。\nＵＢ発動で【フルチャージ】状態になり、【バッテリー】\nが切れるまで強化スキルを連発し、一帯を超速圧砕する。", /*only_disp_owned*/0, /*start_time*/"2023/08/31 12:00:00", /*end_time*/"2023/09/03 18:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/126501, /*unit_name*/"ライラエル", /*kana*/"らいらえる", /*prefab_id*/126501, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/0, /*se_type*/7, /*move_speed*/450, /*search_area_width*/740, /*atk_type*/2, /*normal_atk_cast_time*/1.965, /*cutin_1*/126501, /*cutin_2*/0, /*cutin1_star6*/126501, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【魔法】後衛で優美にほほ笑むジオ・テオゴニアの姫君。\n開始時に発動する【界雷】で、敵味方に影響を与えつつ、\n魔法防御ダウンと強力なダメージスキルで裁きを下す。", /*only_disp_owned*/0, /*start_time*/"2023/08/31 12:00:00", /*end_time*/"2023/09/03 18:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/126601, /*unit_name*/"ネネカ（サマー）", /*kana*/"ねねか", /*prefab_id*/126601, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/650, /*atk_type*/2, /*normal_atk_cast_time*/2.04, /*cutin_1*/126601, /*cutin_2*/0, /*cutin1_star6*/126601, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【魔法】後衛で、涼しげに微笑む夏色姿の『変貌大妃』。\nスキルで味方を大幅に強化し、最も魔法攻撃力が高い味方\nの魔法攻撃力を写し取った攻撃力で、強力なＵＢを放つ。", /*only_disp_owned*/0, /*start_time*/"2023/07/03 19:00:00", /*end_time*/"2023/07/12 11:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/126701, /*unit_name*/"アキノ（サマー）", /*kana*/"あきの", /*prefab_id*/126701, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/224, /*atk_type*/1, /*normal_atk_cast_time*/1.965, /*cutin_1*/126701, /*cutin_2*/0, /*cutin1_star6*/126701, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】前衛で、優雅なバカンスを過ごす夕映えの令嬢。\n敵が魔法攻撃をする場合に効果を大幅に上げる２種の範囲\n攻撃と攻防両面の支援スキルで、盛夏の勝鬨を上げる。", /*only_disp_owned*/1, /*start_time*/"2023/06/30 12:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/126801, /*unit_name*/"ユカリ（サマー）", /*kana*/"ゆかり", /*prefab_id*/126801, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/5, /*se_type*/5, /*move_speed*/450, /*search_area_width*/159, /*atk_type*/1, /*normal_atk_cast_time*/1.97, /*cutin_1*/126801, /*cutin_2*/0, /*cutin1_star6*/126801, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】前衛で、夏の麦しゅわを嗜むビーチの元聖騎士。\n敵単体にダメージを与えながら、周囲の味方への魔法無効\nバリア付与と魔防アップで守りを固めて勝利の波に乗る。", /*only_disp_owned*/0, /*start_time*/"2023/07/15 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/126901, /*unit_name*/"ランファ（サマー）", /*kana*/"らんふぁ", /*prefab_id*/126901, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/21, /*se_type*/7, /*move_speed*/450, /*search_area_width*/682, /*atk_type*/2, /*normal_atk_cast_time*/1.965, /*cutin_1*/126901, /*cutin_2*/0, /*cutin1_star6*/126901, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【魔法】後衛で、密やかな潮騒に耳を傾ける晩陽の歌姫。\n魔法クリティカルの極大アップを筆頭に攻防両面で周囲の\n味方を強化し、さらに自身もＵＢで数多の敵を退かせる。", /*only_disp_owned*/0, /*start_time*/"2023/07/31 12:00:00", /*end_time*/"2023/08/09 11:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/127001, /*unit_name*/"クウカ（サマー）", /*kana*/"くうか", /*prefab_id*/127001, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/1, /*motion_type*/52, /*se_type*/2, /*move_speed*/450, /*search_area_width*/133, /*atk_type*/1, /*normal_atk_cast_time*/1.97, /*cutin_1*/127001, /*cutin_2*/0, /*cutin1_star6*/127001, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】前衛で新たな刺激を追い求める水着姿のドＭ娘。\n自分のＨＰが下がるほど効果量が上昇するスキルの物理攻\n撃力アップとＵＢのダメージで、勝利の大海へ飛び込む。", /*only_disp_owned*/1, /*start_time*/"2023/07/31 12:00:00", /*end_time*/"2023/08/14 20:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/127101, /*unit_name*/"シノブ（サマー）", /*kana*/"しのぶ", /*prefab_id*/127101, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/46, /*se_type*/5, /*move_speed*/450, /*search_area_width*/255, /*atk_type*/1, /*normal_atk_cast_time*/2.09, /*cutin_1*/127101, /*cutin_2*/0, /*cutin1_star6*/127101, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】前衛で、穏やかな水面に揺蕩う夜光の霊能少女。\n召喚した親父に敵の攻撃を引き付けさせつつ、シノブ自身\nの攻撃性能強化と防御ダウンを扱い、敵を冥海へと誘う。", /*only_disp_owned*/0, /*start_time*/"2023/08/15 15:00:00", /*end_time*/"2023/08/22 11:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/127201, /*unit_name*/"キャル（編入生）", /*kana*/"きゃる", /*prefab_id*/127201, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/7, /*se_type*/7, /*move_speed*/450, /*search_area_width*/804, /*atk_type*/2, /*normal_atk_cast_time*/2.09, /*cutin_1*/127201, /*cutin_2*/0, /*cutin1_star6*/127201, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【魔法】後衛で、制服姿に胸を高鳴らせるアオハル猫娘。\n攻防両面のサポートに加え行動速度アップとＴＰ回復で味\n方を支援し、最も遠くの敵を狙うＵＢで輝く勝利を得る。", /*only_disp_owned*/0, /*start_time*/"2023/09/03 19:00:00", /*end_time*/"2023/09/12 11:59:59", /*original_unit_id*/0);
