INSERT INTO `unit_data` VALUES (/*unit_id*/127501, /*unit_name*/"サレン（サラサリア）", /*kana*/"されん", /*prefab_id*/127501, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/4, /*se_type*/4, /*move_speed*/450, /*search_area_width*/304, /*atk_type*/1, /*normal_atk_cast_time*/2.09, /*cutin_1*/127501, /*cutin_2*/0, /*cutin1_star6*/127501, /*cutin2_star6*/0, /*guild_id*/0, /*exskill_display*/0, /*comment*/"【物理】中衛で、優艶に炎と踊り舞う情熱のサレンママ。\n物理攻撃から味方を守り、【炎舞の刻印】の数に応じて効\n果の上がる物攻アップとＴＰ回復で皆を奮い立たせる。", /*only_disp_owned*/0, /*start_time*/"2023/09/30 12:00:00", /*end_time*/"2023/10/10 11:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/170101, /*unit_name*/"ジータ", /*kana*/"じーた", /*prefab_id*/170101, /*prefab_id_battle*/0, /*is_limited*/0, /*rarity*/3, /*motion_type*/34, /*se_type*/34, /*move_speed*/450, /*search_area_width*/245, /*atk_type*/1, /*normal_atk_cast_time*/1.965, /*cutin_1*/105701, /*cutin_2*/0, /*cutin1_star6*/170101, /*cutin2_star6*/0, /*guild_id*/4, /*exskill_display*/0, /*comment*/"【物理】前衛で、先手必勝の大技を繰り出す騎空士。\nスキルによるＴＰ回復は、ユニオンバーストの発動を早め\nバトルの序盤から敵前衛に大ダメージを与える。", /*only_disp_owned*/0, /*start_time*/"2015/04/01 15:00:00", /*end_time*/"2030/12/31 15:00:00", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/180101, /*unit_name*/"ヒヨリ（プリンセス）", /*kana*/"ひより", /*prefab_id*/180101, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/0, /*se_type*/0, /*move_speed*/450, /*search_area_width*/199, /*atk_type*/1, /*normal_atk_cast_time*/1.62, /*cutin_1*/180101, /*cutin_2*/0, /*cutin1_star6*/180101, /*cutin2_star6*/0, /*guild_id*/7, /*exskill_display*/0, /*comment*/"【物理】前衛で炎翼を背に敵を粉砕する、陽気な元気娘。\n戦いが続く程に自身の攻撃能力を強めるスキルを操り、\n高めた力で放つ超爆の一撃は、あらゆる敵を塵と化す。", /*only_disp_owned*/0, /*start_time*/"2023/08/31 12:00:00", /*end_time*/"2023/09/03 18:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/180201, /*unit_name*/"ユイ（プリンセス）", /*kana*/"ゆい", /*prefab_id*/180201, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/0, /*se_type*/0, /*move_speed*/450, /*search_area_width*/767, /*atk_type*/2, /*normal_atk_cast_time*/1.92, /*cutin_1*/180201, /*cutin_2*/0, /*cutin1_star6*/180201, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【魔法】後衛から極大魔法で敵を滅する願いの魔法士。\nＴＰを回復しつつ攻撃力を累積アップする補助スキルで\n自身の力を高め、強力な範囲攻撃を放ち敵を一掃する。", /*only_disp_owned*/0, /*start_time*/"2023/08/31 12:00:00", /*end_time*/"2023/09/03 18:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/180301, /*unit_name*/"レイ（プリンセス）", /*kana*/"れい", /*prefab_id*/180301, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/0, /*se_type*/0, /*move_speed*/450, /*search_area_width*/377, /*atk_type*/1, /*normal_atk_cast_time*/1.965, /*cutin_1*/180301, /*cutin_2*/0, /*cutin1_star6*/180301, /*cutin2_star6*/0, /*guild_id*/7, /*exskill_display*/0, /*comment*/"【物理】中衛で風刃を従え激戦を流麗に征く嵐翼の剣士。\n敵が多い程に効果が高まる自己強化スキルで、自身を奮い\n立たせ、強力な範囲攻撃スキルで一切の敵を鏖滅する。", /*only_disp_owned*/0, /*start_time*/"2023/08/31 12:00:00", /*end_time*/"2023/09/03 18:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/180401, /*unit_name*/"ペコリーヌ（プリンセス）", /*kana*/"ぺこりーぬ", /*prefab_id*/180401, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/0, /*se_type*/0, /*move_speed*/450, /*search_area_width*/155, /*atk_type*/1, /*normal_atk_cast_time*/1.965, /*cutin_1*/180401, /*cutin_2*/0, /*cutin1_star6*/180401, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【物理】前衛で、攻防共に絶大な力を誇る腹ペコ王女。\nＨＰが多い時は爆発的な攻撃力で、いかなる敵をも屠り、\nＨＰが減ると自己回復能力を得て、鉄壁の護りを見せる。", /*only_disp_owned*/0, /*start_time*/"2023/08/31 12:00:00", /*end_time*/"2023/09/03 18:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/180501, /*unit_name*/"コッコロ（プリンセス）", /*kana*/"こっころ", /*prefab_id*/180501, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/0, /*se_type*/0, /*move_speed*/450, /*search_area_width*/555, /*atk_type*/1, /*normal_atk_cast_time*/2.14, /*cutin_1*/180501, /*cutin_2*/0, /*cutin1_star6*/180501, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【物理】中衛で、絶大な補助スキルを繰出す純白の巫女。\n味方の攻撃力とクリティカルダメージを強化しつつ、\n二つの全体回復スキルで味方を堅固に守護し勝利へ導く。", /*only_disp_owned*/0, /*start_time*/"2023/08/31 12:00:00", /*end_time*/"2023/09/03 18:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/180601, /*unit_name*/"キャル（プリンセス）", /*kana*/"きゃる", /*prefab_id*/180601, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/0, /*se_type*/0, /*move_speed*/450, /*search_area_width*/747, /*atk_type*/2, /*normal_atk_cast_time*/1.92, /*cutin_1*/180601, /*cutin_2*/0, /*cutin1_star6*/180601, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【魔法】後衛で、極大魔法を操り敵を討つ姫装の猫娘。\n回復や補助を兼ねた各攻撃スキルを駆使し戦況を整え、\n極大威力のユニオンバーストを撃ち込み敵を燼滅する。", /*only_disp_owned*/0, /*start_time*/"2023/08/31 12:00:00", /*end_time*/"2023/09/03 18:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/180701, /*unit_name*/"ハツネ＆シオリ", /*kana*/"はつねしおり", /*prefab_id*/180701, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/0, /*se_type*/0, /*move_speed*/450, /*search_area_width*/732, /*atk_type*/1, /*normal_atk_cast_time*/1.75, /*cutin_1*/180701, /*cutin_2*/0, /*cutin1_star6*/180701, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【物理】後衛から、真の絆の力を発揮する仲良し姉妹。\n敵の数が増えるほど威力が高まる攻撃スキルと、周りの\n味方を強化するスキルを操り、立ち塞がる敵を一掃する。", /*only_disp_owned*/0, /*start_time*/"2023/08/31 12:00:00", /*end_time*/"2023/09/03 18:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/180801, /*unit_name*/"ミソギ＆ミミ＆キョウカ", /*kana*/"みそぎみみきょうか", /*prefab_id*/180801, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/0, /*se_type*/0, /*move_speed*/450, /*search_area_width*/465, /*atk_type*/1, /*normal_atk_cast_time*/1.5, /*cutin_1*/180801, /*cutin_2*/0, /*cutin1_star6*/180801, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【物理】中衛で敵単体に必殺の一撃を放つ仲良しトリオ。\n３人の力を合わせて放つ攻撃は、相手の弱点に合わせて\n物理から魔法攻撃に変化し、どんな強い敵も退治する！", /*only_disp_owned*/0, /*start_time*/"2023/08/31 12:00:00", /*end_time*/"2023/09/03 18:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/180901, /*unit_name*/"アキノ＆サレン", /*kana*/"あきのされん", /*prefab_id*/180901, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/0, /*se_type*/0, /*move_speed*/450, /*search_area_width*/421, /*atk_type*/1, /*normal_atk_cast_time*/2.09, /*cutin_1*/180901, /*cutin_2*/0, /*cutin1_star6*/180901, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【物理】中衛で背を預けあう最高の好敵手で親友の二人。\n味方の物理攻撃をサポートしつつＨＰとＴＰを継続回復し\nＨＰが多いほど威力が増すＵＢで、共に勝利の道を征く。", /*only_disp_owned*/0, /*start_time*/"2023/08/31 12:00:00", /*end_time*/"2023/09/03 18:59:59", /*original_unit_id*/0);
INSERT INTO `unit_data` VALUES (/*unit_id*/181001, /*unit_name*/"アン＆グレア", /*kana*/"あんぐれあ", /*prefab_id*/181001, /*prefab_id_battle*/0, /*is_limited*/1, /*rarity*/3, /*motion_type*/0, /*se_type*/0, /*move_speed*/450, /*search_area_width*/577, /*atk_type*/2, /*normal_atk_cast_time*/2.09, /*cutin_1*/181001, /*cutin_2*/0, /*cutin1_star6*/181001, /*cutin2_star6*/0, /*guild_id*/1, /*exskill_display*/0, /*comment*/"【魔法】中衛で、魔力共鳴し連撃を放つマナリアの双姫。\nステータスアップ効果を受けると増加する【友情の魔印】\nがスキルを強化し、波長を合わせた炎の魔槍で敵を討つ。", /*only_disp_owned*/0, /*start_time*/"2023/08/31 12:00:00", /*end_time*/"2023/09/03 18:59:59", /*original_unit_id*/0);
